import { createContext, useState } from 'react';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import Home from './Component/Router/Home';

function App() {

  return (
    <Router>
      <Routes path='/'>
        <Route index element={<Home />} />
      </Routes>
    </Router>
  );
}
export default App;
